import mail from "./images/mail-blue.png";
import github from "./images/github-blue.png";
import linkedin from "./images/linkedin-blue.png";
import { Link, BrowserRouter as Router, Route, Switch } from "react-router-dom";

export default function Navbar() {
  return (
    <div className="Navbar">
      <div className="NavbarLeft">Annika Davis | Work | About</div>
      <div className="NavbarRight">
        <Link to="mailto:annikadavis@gmail.com">
          <img src={mail} alt="mail-icon" />
        </Link>
        <img src={github} alt="github-icon" />
        <img src={linkedin} alt="linkedin-icon" />
      </div>
    </div>
  );
}
